INSERT INTO [dbo].[Product] ([ProductID], [NamePro], [DecriptionPro], [CateID], [Price], [ImagePro], [Quantity]) VALUES (17, N'Vans Ouroboros Slip-On', N'Vans là thương hiệu thời trang chuyên về giày trượt ván, quần áo và phụ kiện của Mỹ, được thành lập tại Anaheim, California và thuộc sở hữu của tập đoàn VF Corporation.Giày Vans siêu nổi tiếng thực chất là một thương hiệu ván trượt với giá trị hàng tỷ đô đến từ nước Mỹ. Ngay từ phong cách, thiết kế, chúng ta cũng thấy bật lên những đường nét quen thuộc của những anh chàng người Mỹ trẻ tuổi, năng động, khỏe khoắn và siêu ngầu.Những đôi giày mà Vans mang lại đều có thể phổ cập đến nhiều tín đồ mê giày trên toàn thế giới. Giá thành rẻ , đa dạng kiểu dáng và màu sắc.
 N'cam kết chính hãng'', 5, CAST(1600000.00 AS Decimal(18, 2)), N'~/Content/images/vans7.png', 100)
