INSERT INTO [dbo].[Product] ([ProductID], [NamePro], [DecriptionPro], [CateID], [Price], [ImagePro], [Quantity]) VALUES (21, N'Converse Chuck Taylor All Star 70 Plus', N'Converse có lịch sử phát triển lâu đời hơn các dòng giày thể thao như Nike và Adidas. Năm 1908, Hầu tước M. Converse thành lập Công ty Giày cao su Converse ở Malden, Massachusetts. Đây chỉ là bước khởi đầu của thương hiệu, năm 1915 Converse bắt đầu sản xuất giày tennis, đây là bước ngoặt quan trọng trong lịch sử của Converse khi giày bóng rổ Converse All-Star được đưa ra thị trường vào năm 1917. Converse All Star đã trở thành đôi giày được chỉ định cho trận đấu bóng rổ quốc tế của Mỹ.Ưu điểm của Converse Classic là: rẻ, bền, đẹp. Một đôi giày phù hợp với tất cả mọi người, phù hợp với mọi set đồ của bạn. Đặc biệt sau hàng trăm năm lịch sử, công trình này chưa bao giờ lỗi thời.
 N'cam kết chính hãng'', 2, CAST(2500000.00 AS Decimal(18, 2)), N'~/Content/images/Converse1.jpg', 99)
